import './App.css';
import { Navbar } from './components/navbar/Navbar';
function App() {

  const links = [
    { text: 'About', url: '/about' },
    { text: 'Experience', url: '/experience' },
    { text: 'Skills', url: '/skills' },
    { text: 'Contact', url: '/contact' },
  ];

  return (
    <>
      <Navbar links={links} />
    </>
  );
}

export default App;
